import styled from "styled-components";

export const Section = styled.div`
  margin: 1rem;
  padding: 1rem;
  background-color: #528124;
  position: fixed;
  bottom: 0;
  left: 0;
  width: 100%;
  margin: 0 auto;
  display: flex;
  align-content: center;
  align-items: center;
  justify-content: center;
  justify-items: center;
  padding: 1rem;
`;

export const Icons = styled.div``;
